import fetcher from './fetcher';


const getCitiesByCountry = async (countryId) => {
    try {
        const cities = await fetcher.get(`cities/${countryId}`);
        console.log("here cities", cities.data)
        return cities.data;
    }catch(error){
        console.log(error)
    }
} 

export {getCitiesByCountry};
